import React from 'react'
import styled from 'styled-components';
import Announcements from '../components/Announcements';
import Navbar from '../components/Navbar';


const Container = styled.div``;

const Login = () => {
  return (

    <div>

        <Announcements />

        <Container>
            Register
        </Container>

    </div>
  )
}

export default Login
